function AnchorPointInit(){$(".anchor_point").hasClass("anchor_inpage")?$(".anchor_point").each((function(){var t=$(this),n=t.data("anchorid").split(",");if(n.length>0){var a=[];n.forEach((t=>{for(var n=$(t),e=n.text().substr(0,n.text().indexOf("\n"));""==e;)e=(n=$(t).children().first()).text().substr(0,n.text().indexOf("\n"));a.push(e)}));for(var e=0;e<n.length;e++)t.children("ul").append(`<li class="fs-5"><a class="text-black text-decoration-none" href="${n[e]}"><div class="p-2 px-4">${a[e]}</div></a></li>`);t.children('a[href^="#"]').click((function(t){var n=$(this).attr("href");console.log(n);var a=$(n).offset().top-50;$("html, body").animate({scrollTop:a},0),t.preventDefault()}))}})):console.log("OutPage")}